import './App.css';
import { Navbar, Container } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Navbar>
        <Container>
            <Navbar.Brand>Brand link</Navbar.Brand>
        </Container>
      </Navbar>
      <header className="App-header">
        <h1>Testing</h1>
      </header>
    </div>
  );
}

export default App;
